    private(set) var data: [Base] = []
    var layers: [String] = []
    var formattedLayers: String {
        var result = ""
        for item in layers {
            result += item + ","
        }
        result = result.replacingOccurrences(of: "null,", with: "")
        result = result.removingSuffix(",")
        return result
    }
    
    private init() {
        do {
            if let jsonArray = try JSONSerialization.jsonObject(with: stringData.data(using: .utf8)!, options : .allowFragments) as? [NSDictionary] {
                for json in jsonArray {
                    let base = Base(with: json)
                    data.append(base)
                }
            } else {
                print("bad json")
            }
        } catch let error as NSError {
            print(error)
        }
        data.remove(at: 0)
        data.removeLast()
    }
